import { useNavigate } from 'react-router-dom';
import "./Title.css";

export default function Title() {
    const navigate=useNavigate();

    const handleClick= () => {
        navigate('/home');
    };

    return <div onClick={handleClick}>
        KITTIVISION
    </div>
}
